// TODO copy pasted from guide, make sure we understand what all this is doing
// https://github.com/spring-guides/tut-react-and-spring-data-rest/blob/master/basic/src/main/js/api/uriTemplateInterceptor.js

define(function(require) {
	'use strict';

	const interceptor = require('rest/interceptor');

	return interceptor({
		request: function (request /*, config, meta */) {
			/* If the URI is a URI Template per RFC 6570 (https://tools.ietf.org/html/rfc6570), trim out the template part */
			if (request.path.indexOf('{') === -1) {
				return request;
			} else {
				request.path = request.path.split('{')[0];
				return request;
			}
		}
	});

});
